import React from 'react'
import Card from './Card'
import AAddCard from './AAddCard'


export default function CardsList({ mesCards, handleAddCards }) {

    return (

        <div>
            <div>
                {mesCards.map(card => (
                    <Card
                        text={card.text}

                        image={card.image}
                    />
                ))}
            </div>
            <AAddCard handleAddCards={handleAddCards} />
        </div>
    )
}
